Hub Gist explaining Git submodules fundamentals. Helped many developers understand submodules effectively.",\n      "url_label": "gist.github.com/gitaarik/8735255",\n      "side_project_achievements": [],\n      "side_project_technologies": []\n    },\n    {\n      "name": "Jazzchords",\n      "start_date": "2013-06-24T00:00:00.000Z",\n      "end_date": "2017-12-08T00:00:00.000Z",\n      "url": "https://github.com/gitaarik/jazzchords",\n      "stars": 12,\n      "summary": "Web application for creating and printing professional chord charts using Python/Django and modern frontend technologies.",\n      "url_label": null,\n      "side_project_achievements": [],\n      "side_project_technologies": []\n    },\n    {\n      "name": "Adyengo",\n      "start_date": "2013-08-06T00:00:00.000Z",\n      "end_date": "2020-05-07T00:00:00.000Z",\n      "url": "https://github.com/gitaarik/adyengo",\n      "stars": 10,\n      "summary": "Open-source Django package for Adyen payment integration with recurring payment support. Used in production at Tender-it.",\n      "url_label": null,\n      "side_project_achievements": [],\n      "side_project_technologies": []\n    },\n    {\n      "name": "Monkful",\n      "start_date": "2013-09-03T00:00:00.000Z",\n      "end_date": "2014-10-04T00:00:00.000Z",\n      "url": "https://github.com/gitaarik/monkful",\n      "stars": 10,\n      "summary": "Python package to easily create RESTful API's for MongoEngine documents used for MongoDB database. Inspired by Django REST framework. Used in production at Travelbird.",\n      "url_label": null,\n      "side_project_achievements": [],\n      "side_project_technologies": []\n    }\n  ],\n  "education": [\n    {\n      "institution": "Nova College",\n      "location": "Hoofddorp, NL",\n      "url": "https://www.novacollege.nl/",\n      "area": "Software Development",\n      "study_type": "Dutch Vocational Education (MBO)",\n      "graduation_year": 2007,\n      "start_date": "2004-08-01T00:00:00.000Z",\n      "end_date": "2007-06-15T00:00:00.000Z",\n      "summary": "Comprehensive 4-year program including foundational computer science, algorithms, and data structures."\n    },\n    {\n      "institution": "Mediacollege Amsterdam",\n      "location": "Amsterdam, NL",\n      "url": "https://www.ma-web.nl/",\n      "area": "Audio technician",\n      "study_type": "Dutch Vocational Education (MBO)",\n      "graduation_year": null,\n      "start_date": "2003-08-03T00:00:00.000Z",\n      "end_date": "2004-06-11T00:00:00.000Z",\n      "summary": "I liked many aspects of the field (music & tech), but ultimately decided that it wasn't something I wanted to pursue in."\n    },\n    {\n      "institution": "Kaj Munk College",\n      "location": "Hoofddorp, NL",\n      "url": "https://kajmunk.nl/",\n      "area": "Pre-vocational education",\n      "study_type": "Dutch VMBO-t education",\n      "graduation_year": 2003,\n      "start_date": "1999-08-01T00:00:00.000Z",\n      "end_date": "2003-06-13T00:00:00.000Z",\n      "summary": "Educated in topics like maths, physics, chemistry, biology, geography, economy, history, social studies, Dutch & English."\n    },\n    {\n      "institution": "Valkenburgschool",\n      "location": "Heemstede, NL",\n      "url": null,\n      "area": "Primary education",\n      "study_type": "Dutch primary education",\n      "graduation_year": 1999,\n      "start_date": "1991-08-04T00:00:00.000Z",\n      "end_date": "1999-06-04T00:00:00.000Z",\n      "summary": "Educated in core subjects like Dutch, maths, science, history, geography, gym & creative activities (art, music)."\n    }\n  ],\n  "languages": [\n    {\n      "name": "Dutch",\n      "language_code": "nl",\n      "proficiency": "native"\n    },\n    {\n      "name": "English",\n      "language_code": "en",\n      "proficiency": "fluent"\n    }\n  ],\n  "references": [\n    {\n      "author": "Elmar Krack",\n      "author_position": "Co-founder of Tender-it",\n      "text": "Rik demonstrated exceptional technical leadership by designing and developing our entire platform from the ground up, handling both backend and frontend development with impressive skill."\n    },\n    {\n      "author": "Michal de Groot",\n      "author_position": "Founder of Chipta",\n      "text": "Rik modernized our client-facing interfaces and implemented backend optimizations that delivered substantial performance improvements. His work enabled us to process thousands of tickets rapidly during our busiest periods."\n    }\n  ],\n  "project_stories": [\n    {\n      "title": "Ticketshop performance scaling for big events",\n      "situation": "- Big event clients selling thousands of tickets\\n- Ticketshop having hard times handling large traffic spikes\\n- Performance bottlenecks in processing the orders\\n- Clients needed reliable ticketshop to sell their tickets fast",\n      "task": "- Speed up ticketshop order processing\\n- Handle high-traffic ticketshop spikes\\n- Work with DevOps (Michal) on scaling",\n      "action": "- Optimized SQL queries - got 30-60% speed boost\\n- Refactored Python/Django order processing code\\n- Worked with DevOps (Michal) on flexible scaling setup",\n      "result": "- Big event clients successfully kept/onboarded\\n- 30-60% faster ticket order processing\\n- Scalable ticketshop ready for large events",\n      "reflection": "- I didn't realize how many queries were being done before optimizing\\n- Optimizing complex SQL queries in Django can be challenging\\n- But tools like Silk make debugging very user friendly",\n      "category": "high_impact_projects"\n    },\n    {\n      "title": "LitState - State management library for Lit",\n      "situation": "- I used the library \\"Lit\\" as a lightweight React replacement\\n- Very satisfied about it, but lacked state management library\\n- State management between multiple components cumbersome",\n      "task": "- Wanted to create a dedicated state management library for Lit\\n- Wanted to keep it simple but elegant and easy to use\\n- Wanted to be able to re-use it in any project using Lit",\n      "action": "- Created LitState, a state management library for Lit\\n- Open-sourced & distributed as an NPM package\\n- Created complete and clear documentation",\n      "result": "- Does exactly what I need\\n- Tiny source code, but very intuitive\\n- Works very efficiently\\n- Used successfully in production at Chipta\\n- Got GitHub user engagement, PRs and issues\\n- Maintained package",\n      "reflection": "- Was very much fun creating an open-source NPM package\\n- I'm still happy about the result\\n- It's sad Lit hasn't gained more popularity\\n- I still think it's good modern technology for today:\\n  - Lit is still much faster than React\\n  - LitState is still a very efficient and useful state management library",\n      "category": "high_impact_projects"\n    },\n    {\n      "title": "Zoom OAuth integration during COVID",\n      "situation": "- COVID hit and clients needed virtual events\\n- No Zoom integration in our platform\\n- Event organizers needed seamless online solution",\n      "task": "- Learn Zoom API and OAuth quickly\\n- Integrate client accounts with dashboard\\n- Enable automatic Zoom management for Chipta events",\n      "action": "- Mastered Zoom OAuth and API documentation\\n- Navigated strict app admittance process\\n- Built dashboard integration for client accounts\\n- Created automatic Zoom event management system",\n      "result": "- Many clients successfully organized online events\\n- Helped company survive COVID with less than 40% profit loss\\n- Seamless Chipta-Zoom integration in production",\n      "reflection": "- Zoom Marketplace submission requirements were much more than I expected\\n- After COVID was over, the online event hype disappeared again\\n- COVID was a hard time to be strategical\\n- Clients do appreciate quick acting and temporary solutions",\n      "category": "high_impact_projects"\n    },\n    {\n      "title": "Smart Job Seeker - AI-driven job-matching system",\n      "situation": "- Finding appropriate vacancies takes a lot of time\\n- It's repetitive work\\n- Adjusting resume/CV for every application takes time\\n- Writing custom cover letter takes time\\n- Answering common interview questions takes time\\n- Tracking all running applications takes time",\n      "task": "- Make the process easier, automate repetitive tasks\\n- Use AI to find appropriate job matches\\n- Make a easily customizable resume/CV generation system\\n- Use AI to help write custom cover letters\\n- Save re-usable common interview questions\\n- Have all running applications in overview",\n      "action": "- Created personal platform for job hunting\\n- Used AI tools to match my profile with jobs with OpenAI & Gemini APIs\\n- Created custom resume/CV generation system with Svelte + Directus CMS\\n- Created module to help generate cover letter with AI\\n- Created database for common interview / application questions\\n- Created overview for tracking application status",\n      "result": "- Faster results of suitable vacancies\\n- Better customization for each application\\n- More confident when applying\\n- Process becomes more fun and streamlined\\n- Learning new skills I can use on my resume/CV",\n      "reflection": "- Happy to have started it\\n- Plans to eventually open source it\\n- Useful for the rest of my career",\n      "category": "high_impact_projects"\n    },\n    {\n      "title": "Introduced agile / async team workflow @ Chipta",\n      "situation": "- Early days at Chipta with minimal team structure\\n- 3-5 developers working without established methodologies\\n- Changing requirements from management causing confusion with devs\\n- Need to scale development processes as team grew",\n      "task": "- Introduce structured development methodologies\\n- Get all team members aligned on new processes\\n- Implement tools and workflows for better collaboration\\n- Improve team efficiency and productivity",\n      "action": "- Progressively introduced Scrum/Agile methodologies with team buy-in\\n- Implemented Zulip for structured async collaboration\\n- Established GitLab Merge Request workflow with code reviews\\n- Introduced Git flow and commit message conventions\\n- Set up and managed comprehensive issue ticket system",\n      "result": "- Successfully transitioned team to structured development process\\n- Improved team coordination and reduced miscommunication\\n- Increased development efficiency and code quality\\n- Created scalable processes that supported team growth over 7 years",\n      "reflection": "- An efficient team workflow makes a big difference\\n- There are many ways to do Agile and every team is unique",\n      "category": "leadership_moments"\n    },\n    {\n      "title": "TicketSwap integration deadline for major client",\n      "situation": "- Major event organizer prospect required TicketSwap integration\\n- Hard deadline of 3 weeks to deliver or lose the prospect\\n- Complex coordination needed with external development team",\n      "task": "- Build secure TicketSwap API integration for second-hand ticket validation\\n- Coordinate with TicketSwap developers on protocols and implementation steps\\n- Deliver working solution within 3-week deadline to close the deal",\n      "action": "- Contacted TicketSwap's technical team to establish communication protocols\\n- Coordinated step-by-step implementation process with their developers\\n- Built secure integration with comprehensive testing suite\\n- Managed coordination between TicketSwap team, prospect, and internal stakeholders",\n      "result": "- Delivered integration on time and secured the client\\n- Eliminated ticket fraud for integrated events\\n- Became competitive advantage leading to 15% increase in sales",\n      "reflection": "- Things can be done very fast when all parties have interests\\n- Direct communication between devs of two companies is very efficient",\n      "category": "leadership_moments"\n    },\n    {\n      "title": "Automated integration testing with Selenium",\n      "situation": "- Manual integration testing required before each production deployment\\n- Testing process took up to 1.5 hours per release\\n- Process was error prone because of human errors\\n- Time-consuming manual process slowed down development cycle",\n      "task": "- Eliminate manual testing bottleneck\\n- Enable faster, more reliable deployments\\n- Reduce time investment required for each release\\n- Improve reliability of test results",\n      "action": "- Researched automated testing solutions and selected Selenium\\n- Built comprehensive Selenium test suite covering the existing manual test procedures\\n- Integrated automated tests into deployment pipeline\\n- Created documentation for developers on running tests and creating new ones",\n      "result": "- Reduced integration testing time from 1.5 hours to 5 minutes\\n- Enabled any developer to run complete integration test suite\\n- Increased deployment frequency and confidence\\n- Eliminated testing bottleneck and improved development velocity",\n      "reflection": "- Learned Selenium is pretty cool and not that hard\\n- Learned that creating integration tests is totally worth it if you need to test for every release\\n- Now that I know Selenium, would apply it faster to save time earlier",\n      "category": "learning_experiences"\n    },\n    {\n      "title": "Onboarding junior developer to Django system",\n      "situation": "- New junior developer joined comprehensive Django project\\n- Developer needed to learn Django framework\\n- Complex system with frontend integration\\n- Multiple new skills needed simultaneously",\n      "task": "- Guide developer through system architecture\\n- Teach Django best practices\\n- Train on frontend technologies\\n- Make developer productive on assigned projects",\n      "action": "- Created structured learning plan covering Django and frontend\\n- Paired programming sessions to demonstrate system\\n- Regular code reviews with detailed explanations\\n- Gradually increased project complexity and responsibility",\n      "result": "- Developer became productive within first month\\n- Successfully delivered assigned project features\\n- Developer gained confidence in both Django and frontend\\n- Created reusable onboarding process for future hires",\n      "reflection": "- Learned I need to ask more feedback from developers to understand what they actually need\\n- Junior developer could be stuck without me knowing it\\n- Check in to developers progress and have evaluation sessions\\n\\n- It's useful when developer creates own docs / notes\\n- There are always things to improve about the onboarding process\\n- It's a fun process helping a developer getting up and running",\n      "category": "learning_experiences"\n    },\n    {\n      "title": "React Native App Technical Challenges",\n      "situation": "- Leading React Native mobile app development at Chipta\\n- React Native framework had significant bugs and limitations\\n- Limited documentation and community support available\\n- Tight deadline before festival season start",\n      "task": "- Navigate technical challenges with immature framework\\n- Find solutions to framework bugs and limitations\\n- Deliver functional app on schedule\\n- Ensure app met performance and reliability requirements",\n      "action": "- Helped developer to tackle complex technical issues\\n- Researched React Native & plugins source code to understand underlying problems\\n- Created custom patches for framework bugs we encountered\\n- Made architecture decisions to work around limitations",\n      "result": "- Delivered app on time before festival season started\\n- App significantly improved event scalability and reach\\n- Contributed to 40% revenue increase from mobile ticket sales\\n- Developer gained valuable React Native expertise\\n- Established foundation for future mobile development projects",\n      "reflection": "- Learned that new hip projects from major companies are not necessarily stable or well documented from the start\\n- Was ultimately happy with choosing React Native\\n- Because it matured and is still one of the main ways of creating apps",\n      "category": "challenging_situations"\n    }\n  ],\n  "application_questions": [\n    {\n      "question": "Tell us about your experience building a project with a Python backend.\\n\\n- What kind of project was it?\\n- What technologies and frameworks did you use (e.g., Flask, FastAPI, Django, etc.)?\\n- (Optional) Please share a link (GitHub repo, live demo, or case study) if available.",\n      "answer": "At Chipta I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system. I even modified Django to work with an existing translation system.\\n\\nI added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication and permission checks. I also implemented pagination, nested routing (using drf-nested-routers), filtering (using django-filter), field-based filtering (using drf-flex-fields), and custom APIs with custom urls.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.\\n\\nTo mail the tickets to users, I used Django's EmailMultiAlternatives class to send pretty HTML emails including inline images, not requiring loading external resources.\\n\\nTo create ticket PDFs, I used Django-WeasyPrint, which uses Weasyprint under the hood, and transforms a Django HTML template, including styles and images, to a PDF file.\\n\\nI used Python Fabric to build a comprehensive custom CI/CD pipeline to deploy the project to our servers.\\n\\nI used Selenium to write integration tests to automatically test our frontend.\\n\\nYou can sign up and create a ticketshop yourself at: https://chipta.com/",\n      "title": "Python backend building experience",\n      "source": "AuditOne"\n    },\n    {\n      "question": "Have you built or worked on systems that manage a lot of structured information or documents (e.g., internal platforms, CRMs, audit systems, or similar)? *\\n\\n- Describe what the system did and how you contributed.\\n- What kind of data or documents were handled?\\n- How did you design the backend (APIs, database, integrations, etc.)?\\n- (Optional) Did you add any AI-powered or automation features using Python?",\n      "answer": "At Tender-it, I created a Django + Celery project that ran web crawlers that scraped tender data from various sources in various formats, then parsed that data into one format and saved it to the database. A A tender is a formal competitive bidding process for contracts, usually big government projects. The scripts would import thousands of tenders each day. Then I created a web platform with an Elasticsearch-based search engine to search, filter, sort and score these tenders.\\n\\nSome sources offered a REST API with JSON or structured data in some way. In those cases it was easy to get the data parse it. But many sources had out-of-date technology, and I needed to use unconventional methods to get the data, like website scraping, API reverse engineering, zip files with XML files over FTP, CSV files over email.\\n\\nSo I created a base class for importing the data and a base class for parsing the data. Then for each source I created a class, inheriting the base class and implementing the required methods. The base classes provided many helper methods for implementing common functionality. Like this I could easily add new sources.\\n\\nI imported all structured data into the MariaDB database. Then I created records in Elasticsearch with all the data that should be search-able, with a reference to the complete data in the database. In this way I could use Elasticsearch to efficiently find the desired record, and when found, fetch the complete info from the database.",\n      "title": "Data management system experience",\n      "source": "AuditOne"\n    },\n    {\n      "question": "Tell us about a project where you built or shipped a full-stack application. What was your role, and what technologies did you use?",\n      "answer": "At Chipta, I led a project creating a ticket scanning app, to scan and validate event entrance tickets, using the phone camera. I decided on using React Native, and guided a medior developer to set up the project and make architectural decisions. I focused on providing the REST APIs and the related business logic.\\n\\nThe scan app would often be used by multiple people at the same time. So I had to make sure to keep the scan apps synchronized, so the same ticket could not be used multiple times. I used a websocket connection between the apps and the Django backend, using Django Channels. With an open websocket connection, I could instantly send data from the app to the backend and vice-versa, without any request overhead. This allowed me to create a custom protocol to send various types of data, like ticket scans, or undo-ing a scan, or even adding more valid tickets.\\n\\nWhen an app scanned a ticket, it send data about it to the backend over the websocket connection. Then the backend would broadcast this scan data to the other scan apps with open websocket connections, synchronizing the apps. Also, if an administrator would update the status of a visitor's ticket in the backend, it would also be broadcasted over the websockets.\\n\\nWe also created functionality for offline usage. The scan app would locally cache the tickets, and if the internet connection would be temporarily gone, still be able to scan tickets. After connection came back, it would restore synchronization and have custom conflict resolution in case of conflicts.\\n\\nThe scan app was successfully released on the Google Play Store and Apple App Store, under the name \\"Chipta\\". Hundreds of event organizers have successfully used it to validate tickets from over a million of visitors at their events. The app was very important for Chipta's growth as it significantly reduced custom scanner hardware costs and management, and  contributed to a 40% revenue increase in the 2 years after the release.\\n\\nChipta in the Google Play Store:\\nhttps://play.google.com/store/apps/details?id=com.chipta\\n\\nChipta in the Apple App Store:\\nhttps://apps.apple.com/us/app/chipta/id1156524548",\n      "title": "Full-stack app building experience",\n      "source": "AuditOne"\n    }\n  ],\n  "cheat_sheets": [\n    {\n      "title": "Intro Talk - EN",\n      "content": "# Interview Introduction Cheat Sheet\\n\\n## Main\\n\\n- Dutch Senior Full Stack Developer\\n- 18+ years of experience\\n- currently based in Spain\\n- specialize in Python & Node.js ecosystems\\n- Strong on both back & frontend\\n\\n## More\\n\\n- Lot of experience scaling high-traffic applications\\n- 5+ years remote work experience\\n- Experience in both startup and enterprise environments\\n- Agile methodologies experience\\n\\n## Chipta\\n\\n- 10 years Lead Developer @ Chipta\\n- Managed teams of 3-5 developers\\n- Built ticketing platform:\\n  - Served thousands of events\\n  - Processing thousands of tickets/minute\\n  - Processed tens of millions in ticket sales\\n- High-traffic page performance improvements (40-60%)\\n\\n### Achievements\\n\\n- Transformed proof-of-concept into competitive ticketing platform\\n- Serving thousands of events\\n- Processing high-volume traffic reliably\\n\\n### Left because\\n\\nDidn't reach the breakthrough we hoped for.\\n\\n## Tender-it\\n\\n- Built complete platform from scratch\\n- Agile workflow with non-technical founders\\n- Extensive search engine using Elasticsearch\\n- Crawling websites, process & import data\\n- Built subscription system with recurring payments\\n\\n### Achievements\\n\\n- Delivered complete product to requirements of founders\\n- Helping companies find appropriate tenders easily\\n\\n### Left because\\n\\nCompetitor overtook us.\\n\\n## TravelBird\\n\\n- Rapidly growing company\\n- Part of innovative mobile team\\n- Objective-C + XCode\\n- API architect for mobile apps\\n\\n### Left because\\n\\nWasn't satisfied with company reorganization.\\n\\n##  Technical Expertise\\n\\n### Expert\\n\\n- Python (Django, DRF, Channels, Silk, Celery)\\n- JavaScript/Node.js (React, MobX, Svelte, Lit, Webcomponents)\\n- SQL databases (PostgreSQL, MySQL, SQLite)\\n- Linux, DevOps, CI/CD\\n- Vercel, Linode, AWS\\n- AI-accelerated development (Claude Code, Cursor)\\n\\n## Work principles\\n\\n- Agile, Scrum, Kanban\\n- Security-first mindset\\n- TDD\\n- Component-based development\\n- UX\\n- Code reviewing\\n- Documentation\\n\\n## Concrete Achievements\\n\\n- Platform scaling\\n  - Profiling\\n  - Query optimization\\n  - Algorithmic optimization\\n  - Caching\\n  - Load balancing\\n  - Auto-scaling servers\\n\\n- API integrations\\n  - Connect DB to third-parties\\n  - OAuth integrations for account sharing\\n\\n- Payment integrations\\n  - Mollie\\n  - Pay.nl\\n  - Adyen\\n  - Paypal\\n\\n- Internationalization\\n  - Translations\\n  - Location-aware content\\n  - Multi-currency support\\n\\n- Test suite\\n  - TDD\\n  - Unit tests\\n  - Integration tests (with Selenium)\\n\\n##  Personal Touch (when appropriate)\\n\\n- Playing guitar since age 12, had a band\\n- Got into web development by creating website for band\\n- Travel & nature lover\\n  - Walked Camino de Santiago\\n  - Traveled around Mexico & Ecuador\\n\\n## Current situation\\n\\n- Renting out house in NL\\n- Traveled south in camper\\n- Family/friends across Spain & Portugal\\n- Currently working from sister's office in southern Spain\\n  - Plenty of space & dedicated workspace\\n\\n## What I'm Looking For\\n\\n- Remote work\\n- Projects 6-12 months\\n- Long-term part-time\\n- Innovative agile (startup) environments\\n\\n## Recent technologies of interest?\\n\\n- AI-accelerated development (Claude, Cursor)\\n- AI / LLM integrations (OpenAI API)\\n- Svelte & Tailwind\\n- Machine Learning & Data Science\\n\\n## Recent projects\\n\\n- Handy House Manual\\n- SmartFeed\\n- Smart Home integrations (ESP32, Raspi)\\n- Portfolio & CV\\n\\n---\\n\\n## Common Follow-up Questions\\n\\n### Challenging projects?\\n\\n- Scaling (Chipta)\\n  - Figuring out what/why slow\\n  - How to optimize\\n  - Testing optimizations\\n\\n- Team leadership (Chipta)\\n  - Guidance, what someone needs\\n  - Estimate someone's skills\\n  - Reviewing code & giving feedback\\n\\n- Developing complete project (Tender-it)\\n  - Taking responsibility of full stack\\n    - Dealing with problems on all layers of stack\\n  - Scrum planning\\n  - Coordinating with non-technical founders\\n\\n- Mobile app development (TravelBird & Chipta)\\n  - Learning new technologies\\n  - App/Play store review policies\\n  - Testing on various devices\\n  - Web Sockets for Chipta Scan App\\n\\n### Why remote work?\\"\\n\\n- Love traveling & nature\\n- Efficiency & flexibility\\n- Stay focussed with Scrum / Agile methodologies\\n- Collaboration software (Slack, Teams, Zoom)\\n- 5+ years experience\\n- I believe in it\\n"\n    },\n    {\n      "title": "Why I quit Chipta",\n      "content": "After 10 incredible years at Chipta, I'm proud of what we accomplished - we\\nbuilt a robust ticketing platform that scaled to handle thousands of tickets per\\nminute and served thousands of events. I led the technical development from\\nconcept through significant growth, and we created a solid product that competed\\nwell in the market.\\n\\nHowever, after a decade of dedication, the company hadn't achieved the market\\nbreakthrough we'd hoped for. While we had technical success and served our\\nclients well, the business faced ongoing challenges in scaling to the next\\nlevel. I realized it was time for me to seek new challenges where I could apply\\neverything I'd learned in a fresh environment with different growth\\nopportunities.\\n\\nThose 10 years taught me invaluable lessons about building scalable systems,\\nleading teams, and the realities of startup growth. I'm excited to bring that\\nexperience to a new role where I can make an immediate impact."\n    }\n  ],\n  "salary_expectations": [\n    {\n      "job_title": "Senior Python SWE",\n      "company_type": "enterprise",\n      "employment_type": "fte",\n      "work_arrangement": "remote",\n      "region": "eu_west_north",\n      "hourly_rate": 35,\n      "month_salary": 6000,\n      "year_salary": 80000,\n      "daily_rate": 280\n    },\n    {\n      "job_title": "Senior Python SWE",\n      "company_type": "enterprise",\n      "employment_type": "contract",\n      "work_arrangement": "remote",\n      "region": "eu_west_north",\n      "hourly_rate": 70,\n      "month_salary": 12000,\n      "year_salary": 145000,\n      "daily_rate": 550\n    }\n  ]\n}	1
