4921	5035	vacancies	3	{"id":3,"status":"published","date_created":"2025-11-03T13:52:27.441Z","date_updated":"2025-11-03T15:11:13.540Z","source_url":"https://www.linkedin.com/jobs/view/4333275011/","title":"Fullstack Software Developer","job_description":"Job Title: Fullstack Engineer\\n\\n\\nJob Type: Full-time\\n\\n\\nLocation: Remote\\n\\n\\nAbout Us:\\n\\n\\nThe AI platform for human intelligencewe build models that rigorously vet PhDs and scale human data training for frontier LLMs.\\n\\n\\nOur agent, Zara, autonomously sources and evaluates world-class researchers and data trainerspowering post-training (RLHF, evals, red-teaming) for top AI labs, modernizing staffing firms, and helping startups hire their core AI teams.\\n\\n\\nAbout the Role:\\n\\nJoin us as a Fullstack Software Engineer to design, build, and scale high-impact applications from front to back. Youll architect robust APIs, craft intuitive interfaces, and deploy secure, cloud-native solutions. We value engineers who write clean code, communicate clearly, and thrive in collaborative environments.\\n\\n\\nKey Responsibilities:\\n\\n    Develop, deploy, and maintain REST APIs and microservices using Python (FastAPI/Flask) or Node.js (TypeScript/Express/Koa).\\n    Build performant, maintainable frontend applications using React.js and Next.js (SSR, SSG, dynamic routing, API routes).\\n    Implement state management with Redux Toolkit, Zustand, or React Query.\\n    Design and optimize PostgreSQL schemas and queries for scalability and reliability.\\n    Create responsive, pixel-perfect UIs with TailwindCSS and Styled Components.\\n    Integrate with internal/external APIs (e.g., Slack, Google Sheets).\\n    Deploy, monitor, and secure apps using AWS (EC2, S3, Lambda, CloudFront, etc.) and Nginx.\\n    Maintain clean, well-documented code and participate in code reviews.\\n\\n\\nWhat We're Looking For:\\n\\n    Deep hands-on experience with React.js, Next.js, and TypeScript.\\n    Proven ability to build and scale backend systems in Python or Node.js.\\n    Strong understanding of state management, asynchronous programming, and PostgreSQL optimization.\\n    Experience with AWS and Nginx in production environments.\\n    Exceptional attention to UI detail and cross-browser responsiveness.\\n    Excellent communication and collaboration skills.\\n\\n\\nNice to Have:\\n\\n    Experience with workflow automation, CI/CD, Docker/Kubernetes, or Infrastructure as Code (Terraform, Ansible).\\n    Familiarity with Pydantic, advanced TypeScript types, and performance optimization for distributed systems.","job_poster":"micro1","import_source":"linkedin","vacancy_resources":[1]}	{"date_updated":"2025-11-03T15:11:13.540Z"}	\N	\N
