5003	5127	vacancies	6	{"source_url":"https://www.linkedin.com/jobs/view/4333609605/","import_source":"linkedin","status":"published","title":"Full Stack Software Engineering Position","job_poster":"Flex Living","job_description":"Join The Team Reinventing How The World Rents.\\n\\nAt The Flex, we believe renting a home should be as effortless as ordering an Uber.\\n\\nOur mission is bold: to make renting borderless, instant, and intelligent.\\n\\nThrough Base360.ai  our proprietary platform  were building the digital nervous system of the rental world: connecting property data, automating operations, and creating an intelligent layer that powers every stay, everywhere.\\n\\nIf youre an engineer who thrives at the intersection of automation, AI, and real-world impact, this is your chance to help redefine how millions live and move.\\n\\n What Youll Build\\n\\nAs a Full Stack Engineer, youll architect and scale the systems behind The Flex  from frictionless guest journeys and automated check-ins to predictive pricing and operational intelligence.\\n\\nYoull work across the stack and across continents, turning complex real estate problems into clean, efficient, and scalable solutions.\\n\\nYou wont just ship features  youll engineer efficiency, eliminate friction, and build the backbone of the intelligent rental economy.\\n\\n Your Mission\\n\\n    Build the Core  Develop scalable, high-performance web apps that power bookings, payments, and automation workflows.\\n    Automate Everything  Design AI-driven scripts and microservices to eliminate repetitive manual tasks.\\n    Integrate Intelligently  Build and optimize APIs linking Base360.ai with key platforms like Airbnb, Stripe, and Twilio.\\n    Ship Fast, Scale Smart  Manage and deploy cloud infrastructure (AWS, serverless) for speed, reliability, and growth.\\n    Solve Problems That Matter  Tackle challenges like global booking sync, predictive pricing, and live operational insights.\\n    Collaborate Deeply  Par