5321	5452	application_interview_questions	28	{"id":28,"sort":null,"date_created":"2025-11-04T13:29:56.531Z","date_updated":"2025-11-05T10:24:59.168Z","application":6,"question":"Tell us about a time when you \\"hacked the system\\" to your advantage","answer":"I'm currently creating a system for myself to help me find and apply for jobs. I'm using AI implementations (OpenAI, Gemini) to find the best matching jobs that meet my preferences. Various modules in the system help me with different tasks, like customizing my resume / CV, writing suitable cover letters, answering common application questions, and preparing for interviews. The system also gives an overview of your applications, where I can see and update the status and other details.\\n\\nAnother time I created my own fully customized desktop environment using awesome-wm and lua scripts. This DE is lightweight, simplistic, but feature-complete, and highly keyboard driven. It supports multiple desktops, multiple monitors, and it remembers and restores the location and position of windows across reboots. Because I can fully customize it and configure endless keyboard shortcuts, it allows me to work very efficiently. This setup ties in nicely with my tmux and Neovim workflows."}	{"answer":"I'm currently creating a system for myself to help me find and apply for jobs. I'm using AI implementations (OpenAI, Gemini) to find the best matching jobs that meet my preferences. Various modules in the system help me with different tasks, like customizing my resume / CV, writing suitable cover letters, answering common application questions, and preparing for interviews. The system also gives an overview of your applications, where I can see and update the status and other details.\\n\\nAnother time I created my own fully customized desktop environment using awesome-wm and lua scripts. This DE is lightweight, simplistic, but feature-complete, and highly keyboard driven. It supports multiple desktops, multiple monitors, and it remembers and restores the location and position of windows across reboots. Because I can fully customize it and configure endless keyboard shortcuts, it allows me to work very efficiently. This setup ties in nicely with my tmux and Neovim workflows.","date_updated":"2025-11-05T10:24:59.168Z"}	5322	\N
