5405	5537	vacancies	7	{"status":"published","import_source":"linkedin","source_url":"https://www.linkedin.com/jobs/view/4320062959/","title":"Senior Software Engineer - Full Stack","job_poster":"Cello","job_description":"We believe the future of marketing is word-of-mouth. Our trusted referral platform puts word-of-mouth marketing on autopilot by rewarding users (and affiliates) for sharing the product they love! The only all-in-one referral platform for B2B SaaS.\\n\\n\\nWeve raised $8.3M total funding led by top-tier investors, and were now looking for a Senior Software Engineer(m/f/x) to help us realize our committed vision.\\n\\n\\n Why join\\n\\n    Unique growth opportunity: early-stage GrowthTech start-up backed by top-tier investors ($8.3M total funding).\\n    Complex and interesting product: APIs, attribution models, recommendation engines, and more.\\n    Strong momentum: SaaS companies need cost-effective sales channels  were the solution.\\n    Build the engineering culture youd recommend to your ex-colleagues.\\n    We onboard 15+ new customers every month and already reach 6M+ monthly users.\\n    Work with an experienced founding team (ex-Twilio, Wise, Skype).\\n\\n\\n What Were Building\\n\\nWe help SaaS companies turn users into their best sales channel. Our platform powers referrals, sharing & recommendations - used by millions monthly.\\n\\n\\nTech stack includes:\\n\\n    Frontend widgets embedded into customer apps.\\n    High-performance APIs for seamless integrations.\\n    Full customer portal for managing campaigns & analytics.\\n\\n\\nUnder the hood: attribution models, recommendation engines, scaling millions of events  much more than a simple web app.\\n\\n\\nYour Mission\\n\\nWe are currently looking for a Senior Full Stack Engineer (m/f/x).\\n\\n    Stack: NestJS  Python  AWS  React\\n    Work directly with stakeholders - no walls, no ticket factory.\\n    Build new features and improve existing systems.\\n    Pragmatic balance:\\n    Sometimes we ship fast to learn, sometimes we slow down to fix the foundation - youll help decide where to lean.\\n    Have real influence on architecture and product direction - not just coding tickets.\\n\\n\\nAbout You\\n\\nRequired\\n\\n    Good communication skills and a friendly, collaborative attitude\\n    Good English skills (written&spoken)\\n    You know when good enough is right - and when to invest in quality\\n    Solid experience: NestJS/Python or similar, and AWS is a must, React or similar\\n    Comfortable debugging complex problems\\n    Contribute ideas, challenge assumptions, shape solutions\\n    Use AI tools wisely, but dont depend on them\\n\\n\\nNice-to-haves\\n\\n    Experience with mobile development (React Native, Flutter, etc.)\\n    Familiarity with data warehousing / analytics (e.g. Snowflake, ClickHouse, or similar)\\n\\n\\nCompany Benefits\\n\\n In the end its all about the team and our culture. Understand why we love our job and see what its like to work at Cello in our People Playbook. We have some compelling perks and benefits.\\n\\n    Competitive, adjustable compensation based on your appetite between equity/cash\\n    vESOPs based on the generous Index Ventures guidelines, which sets us apart from most European startups\\n    Remote-first global company with local hubs. We hire the best, senior people regardless of location\\n    Flexible office allowance to support your hybrid or fully-remote working model\\n    Build your perfect setup to do the best work of your life. Mac/Windows, plugins, cutting-edge tech stack Tell us what you need to be productive and we will take care of it\\n    Monthly learning allowance to satisfy your thirst for growth and lifelong learning\\n    Quarterly culture weeks where we come together, celebrate and set the course for the coming months. We have chosen to work remotely, but we encourage frequent face-to-face time"}	{"status":"published","import_source":"linkedin","source_url":"https://www.lin