5679	5845	application_questions	1	{"id":1,"sort":1,"date_created":"2025-10-20T12:33:01.867Z","date_updated":"2025-11-06T16:46:26.165Z","question":"Tell us about your experience building a project with a Python backend.\\n\\n- What kind of project was it?\\n- What technologies and frameworks did you use (e.g., Flask, FastAPI, Django, etc.)?\\n- (Optional) Please share a link (GitHub repo, live demo, or case study) if available.","answer":"At Chipta I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system. I even modified Django to work with an existing translation system.\\n\\nI added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication and permission checks. I also implemented pagination, nested routing (using drf-nested-routers), filtering (using django-filter), field-based filtering (using drf-flex-fields), and custom APIs with custom urls.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.\\n\\nTo mail the tickets to users, I used Django's EmailMultiAlternatives class to send pretty HTML emails including inline images, not requiring loading external resources.\\n\\nTo create ticket PDFs, I used Django-WeasyPrint, which uses Weasyprint under the hood, and transforms a Django HTML template, including styles and images, to a PDF file.\\n\\nI used Python Fabric to build a comprehensive custom CI/CD pipeline to deploy the project to our servers.\\n\\nI used Selenium to write integration tests to automatically test our frontend.\\n\\nYou can sign up and create a ticketshop yourself at: https://chipta.com/","title":"Python backend building experience","profile":1,"source":"AuditOne"}	{"profile":1,"date_updated":"2025-11-06T16:46:26.165Z"}	\N	\N
5678	5844	application_questions	12	{"id":12,"sort":1,"date_created":null,"date_updated":"2025-11-06T16:46:22.130Z","question":"Tell us about your experience building a project with a Python backend.\\n\\n- What kind of project was it?\\n- What technologies and frameworks did you use (e.g., Flask, FastAPI, Django, etc.)?\\n- (Optional) Please share a link (GitHub repo, live demo, or case study) if available.","answer":"At Chipta I've build the Django backend from the ground up. I attached Django to an existing database, enabling a smooth transition from the previous system. I even modified Django to work with an existing translation system.\\n\\nI added React to the project for dynamic frontend pages, and used Django REST Framework to create APIs accommodating the React frontend. Many APIs were for admin pages so needed authentication and permission checks. I also implemented pagination, nested routing (using drf-nested-routers), filtering (using django-filter), field-based filtering (using drf-flex-fields), and custom APIs with custom urls.\\n\\nChipta is a ticketing system for event organizers. They can use the system to create a ticket shop and sell their tickets online. I've scaled the system to be able to handle thousands of ticket orders per minute. To optimize the SQL queries and Python processes, I used tools like Django Silk and Django Debug Toolbar.\\n\\nChipta has processed millions of euros in transactions. I developed the ticketshop, API and server processes that handle these transactions. I used payment provider SDKs to create the payments and forward users to the payment page.\\n\\nTo mail the tickets to users, I used Django's EmailMultiAlternatives class to send pretty HTML emails including inline images, not requiring loading external resources.\\n\\nTo create ticket PDFs, I used Django-WeasyPrint, which uses Weasyprint under the hood, and transforms a Django HTML template, including styles and images, to a PDF file.\\n\\nI used Python Fabric to build a comprehensive custom CI/CD pipeline to deploy the project to our servers.\\n\\nI used Selenium to write integration tests to automatically test our frontend.\\n\\nYou can sign up and create a ticketshop yourself at: https://chipta.com/","title":"Python backend building experience","profile":1,"source":"AuditOne"}	{"profile":1,"date_updated":"2025-11-06T16:46:22.130Z"}	\N	\N
5680	5858	cheat_sheets	24	{"id":24,"sort":null,"date_created":null,"date_updated":"2025-11-06T16:48:13.051Z","title":"Why I quit Chipta","content":"After 10 incredible years at Chipta, I'm proud of what we accomplished - we\\nbuilt a robust ticketing platform that scaled to handle thousands of tickets per\\nminute and served thousands of events. I led the technical development from\\nconcept through significant growth, and we created a solid product that competed\\nwell in the market.\\n\\nHowever, after a decade of dedication, the company hadn't achieved the market\\nbreakthrough we'd hoped for. While we had technical success and served our\\nclients well, the business faced ongoing challenges in scaling to the next\\nlevel. I realized it was time for me to seek new challenges where I could apply\\neverything I'd learned in a fresh environment with different growth\\nopportunities.\\n\\nThose 10 years taught me invaluable lessons about building scalable systems,\\nleading teams, and the realities of startup growth. I'm excited to bring that\\nexperience to a new role where I can make an immediate impact.","profile":1}	{"profile":1,"date_updated":"2025-11-06T16:48:13.051Z"}	\N	\N
5682	5865	applications	8	{"profile":1,"vacancy":{"status":"published","import_source":"linkedin","source_url":"https://www.linkedin.com/jobs/view/4257428164/","title":"Senior AI Full Stack Developer (Full Remote) - 1014961622","job_poster":"Leadtech Group","job_description":"At Leadtech, we've been redefining digital businesses since 2009, creating innovative online solutions that reach millions of users every month. With a diverse team of over 700 members from 23+ nationalities, we're united by a passion for creativity and collaboration.\\n\\nWe specialize in delivering user-centric experiences across web and mobile platforms, where people can connect with our products like never before.\\n\\nWe're proud of our global reach and committed to fostering an inclusive workplace where every individual contributes to our shared vision of bringing cutting-edge projects to life. Learn more about our journey and mission on our About us! page!\\n\\nAbout The Role\\n\\nWe are building an innovative platform that leverages a suite of specialized AI agents to automate complex tasks. As a Senior Level Full-Stack Developer, you will be instrumental in building and scaling the Project's platform. You will work across our entire technology stack to deliver a seamless and powerful user experience. You will be joining a project with a clear vision and a modern tech stack.\\n\\n    Extensive knowledge of Python\\n    Develop and maintain features on both our React frontend and Node.js (Express) backend\\n    Build intuitive user interfaces using TypeScript, Vite, and our Shadcn UI component library, enabling users to upload media, manage their analyses, and interact with our AI agents\\n    Design, implement, and maintain RESTful APIs with Express to manage user authentication, data processing, and orchestrate analysis workflows\\n    Build AI Agents with LangGraph that can handle multi-step reasoning, Create workflows where AI agents collaborate or hand off tasks to other agents. Maintain conversation state and context across interactions and Handle complex decision trees and conditional logic\\n    Model Context Protocol (MCP) Knowledge Agents with Claude: to Build AI agents access to real-time data, APIs, and tools Create AI assistants that can actually take actions, Combine the reasoning power of LLMs with real-world integration\\n    Integrate our platform with various external services and APIs, and handle incoming webhooks for processing asynchronous tasks\\n    Collaborate on the integration with our n8n-based workflow automation engine, helping to connect our backend with the AI agents that power our analyses\\n    Collaborate closely with product managers and AI specialists to translate complex requirements into robust, scalable features\\n    Contribute to database schema design and write migrations for our PostgreSQL & BigQuery databases\\n    Knowledge of GCP to Collaborate with the team on application deployment and help maintain our cloud infrastructure on Google Cloud Platform\\n\\nRequirements\\n\\nWhat We're Looking For\\n\\nWe are seeking a proactive and skilled developer who is passionate about building modern, data-driven applications.\\n\\n    Experience: 5+ years of professional experience in a Senior full-stack development role\\n    Extensive experience with the Python framework\\n    TypeScript Proficiency: You are highly proficient in TypeScript and its application in both frontend (React) and backend (Node.js) environments\\n    Frontend Expertise: Strong experience with React and modern state management, including Hooks and the Context API\\n    Backend Expertise: Solid experience building and consuming REST APIs with Node.js and Express\\n    Database Skills: Experience with like PostgreSQL, and working with an ORM or query builder\\n    experience in BigQuery\\n    Knowledge of n8n.io, LangGraph, LangChain\\n    Problem-Solving Mindset: You are a collaborative problem-solver, eager to take on new challenges and contribute to a fast-paced development cycle\\n    Passion for AI: A genuine passion and awareness for artificial intelligence and a strong desire to build products that leverage its capabilities to solve real-world problems\\n    Creativity and Proactivity: You have a passion for building great products, are eager to propose new features, and enjoy finding creative solutions to improve the user experience. \\n\\nNice to Have:\\n\\n    AI Project Experience: Previous experience working on projects involving AI, machine learning, or interacting with large language models (LLMs)\\n    Familiarity with UI component libraries like Shadcn UI\\n    Knowledge of cloud platforms like Google Cloud Platform (GCP)\\n\\nWhy You'll Love Working With Us\\n\\n    High-Impact Role: Be a key player in a small, agile team building a greenfield project with the potential to transform an industry\\n    Modern Technology: Work with a cutting-edge, carefully selected tech stack with a focus on best practices\\n    Growth & Learning: Gain deep experience in AI-driven applications, cloud-native architecture, and real-time systems\\n    Stability & Vision: Enjoy the energy of a startup environment backed by the resources and stability of a large, successful company\\n    Collaborative Culture: We value open communication, teamwork, and a shared passion for building exceptional products\\n\\nIf you are ready to take on a challenging and rewarding role at the intersection of AI and product strategy, we encourage you to apply.\\n\\nBenefits\\n\\nWhy should you join us?\\n\\nGrowth and career development\\n\\n    At Leadtech, we prioritize your growth. Enjoy a flexible career path with personalized internal training and an annual budget for external learning opportunities\\n\\nWork-Life balance\\n\\n    Benefit from a flexible schedule with flextime (7 - 9:30 a.m. start, 3:30 - 6 p.m. end) and the option of working full remote or from our Barcelona office. Enjoy free Friday afternoons with a 7-hour workday, plus a 35-hour workweek in July and August so you can savor summer!\\n\\nComprehensive benefits\\n\\n    Competitive salary, full-time permanent contract, and top-tier private health insurance (including dental and psychological services)\\n    25 days of vacation plus your birthday off, with flexible vacation optionsno blackout days!\\n\\nUnique Perks\\n\\n    If you wish to come, in our office in Barcelona you'll find it coplete with free coffee, fresh fruit, snacks, a game room, and a rooftop terrace with stunning Mediterranean views\\n    Additional benefits include ticket restaurant and nursery vouchers, paid directly from your gross salary\\n\\nJoin us in an environment where you're free to innovate, learn, and grow alongside passionate professionals. At Leadtech, you'll tackle exciting challenges and be part of a vibrant team dedicated to delivering exceptional user experiences\\n\\nSounds good? Apply now! We're looking forward to getting to know you.\\n\\nEqual Employment Opportunity Employer:\\n\\nLeadtech is an Equal Employment Opportunity (EEO) Employer, which means we encourage applications from people with different backgrounds, interests, and personal circumstances. Our team welcomes applicants regardless of their race, gender, age, religion, nationality, sexual orientation, and/or disabilities. All we need is your high energy, skills, and willingness to be a part of a great project!\\n\\nLocation\\n\\nYou'll have the flexibility to choose whether you'd like to come to the office every day, from time to time, or work fully remote. We want you to find the best combination for you.\\n\\nIf you prefer to be surrounded with amazing people, our exceptional office is in Barcelona's Blue Building, located right on the city's seafront. Besides our stunning views, you'll enjoy our office perks such as free fruit, snacks, and coffee and you'll also be able to take part in our Mario Kart and table tennis competitions.\\n\\nThe personal data you provide will be processed in order to manage your candidacy for the corporate selection processes that fit your profile. If you wish, you can exercise your rights of access, rectification or cancellation by writing to our address (Avenida Litoral, 12-14, 5ta planta. Barcelona. 08005) or to the email address protecciondedatos@LeadTech.com, attaching to your request a document that can validate your identity."}}	{"profile":1,"vacancy":{"status":"published","import_source":"linkedin","source_url":"https://www.linkedin.com/jobs/view/4257428164/","title":"Senior AI Full Stack Developer (Full Remote) - 1014961622","job_poster":"Leadtech Group","job_description":"At Leadtech, we've been redefining digital businesses since 2009, creating innovative online solutions that reach millions of users every month. With a diverse team of over 700 members from 23+ nationalities, we're united by a passion for creativity and collaboration.\\n\\nWe specialize in delivering user-centric experiences across web and mobile platforms, where people can connect with our products like never before.\\n\\nWe're proud of our global reach and committed to fostering an inclusive workplace where every individual contributes to our shared vision of bringing cutting-edge projects to life. Learn more about our journey and mission on our About us! page!\\n\\nAbout The Role\\n\\nWe are building an innovative platform that leverages a suite of specialized AI agents to automate complex tasks. As a Senior Level Full-Stack Developer, you will be instrumental in building and scaling the Project's platform. You will work across our entire technology stack to deliver a seamless and powerful user experience. You will be joining a project with a clear vision and a modern tech stack.\\n\\n    Extensive knowledge of Python\\n    Develop and maintain features on both our React frontend and Node.js (Express) backend\\n    Build intuitive user interfaces using TypeScript, Vite, and our Shadcn UI component library, enabling use