 consuming REST APIs with Node.js and Express\\n    Database Skills: Experience with like PostgreSQL, and working with an ORM or query builder\\n    experience in BigQuery\\n    Knowledge of n8n.io, LangGraph, LangChain\\n    Problem-Solving Mindset: You are a collaborative problem-solver, eager to take on new challenges and contribute to a fast-paced development cycle\\n    Passion for AI: A genuine passion and awareness for artificial intelligence and a strong desire to build products that leverage its capabilities to solve real-world problems\\n    Creativity and Proactivity: You have a passion for building great products, are eager to propose new features, and enjoy finding creative solutions to improve the user experience. \\n\\nNice to Have:\\n\\n    AI Project Experience: Previous experience working on projects involving AI, machine learning, or interacting with large language models (LLMs)\\n    Familiarity with UI component libraries like Shadcn UI\\n    Knowledge of cloud platforms like Google Cloud Platform (GCP)\\n\\nWhy You'll Love Working With Us\\n\\n    High-Impact Role: Be a key player in a small, agile team building a greenfield project with the potential to transform an industry\\n    Modern Technology: Work with a cutting-edge, carefully selected tech stack with a focus on best practices\\n    Growth & Learning: Gain deep experience in AI-driven applications, cloud-native architecture, and real-time systems\\n    Stability & Vision: Enjoy the energy of a startup environment backed by the resources and stability of a large, successful company\\n    Collaborative Culture: We value open communication, teamwork, and a shared passion for building exceptional products\\n\\nIf you are ready to take on a challenging and rewarding role at the intersection of AI and product strategy, we encourage you to apply.\\n\\nBenefits\\n\\nWhy should you join us?\\n\\nGrowth and career development\\n\\n    At Leadtech, we prioritize your growth. Enjoy a flexible career path with personalized internal training and an annual budget for external learning opportunities\\n\\nWork-Life balance\\n\\n    Benefit from a flexible schedule with flextime (7 - 9:30 a.m. start, 3:30 - 6 p.m. end) and the option of working full remote or from our Barcelona office. Enjoy free Friday afternoons with a 7-hour workday, plus a 35-hour workweek in July and August so you can savor summer!\\n\\nComprehensive benefits\\n\\n    Competitive salary, full-time permanent contract, and top-tier private health insurance (including dental and psychological services)\\n    25 days of vacation plus your birthday off, with flexible vacation optionsno blackout days!\\n\\nUnique Perks\\n\\n    If you wish to come, in our office in Barcelona you'll find it coplete with free coffee, fresh fruit, snacks, a game room, and a rooftop terrace with stunning Mediterranean views\\n    Additional benefits include ticket restaurant and nursery vouchers, paid directly from your gross salary\\n\\nJoin us in an environment where you're free to innovate, learn, and grow alongside passionate professionals. At Leadtech, you'll tackle exciting challenges and be part of a vibrant team dedicated to delivering exceptional user experiences\\n\\nSounds good? Apply now! We're looking forward to getting to know you.\\n\\nEqual Employment Opportunity Employer:\\n\\nLeadtech is an Equal Employment Opportunity (EEO) Employer, which means we encourage applications from people with different backgrounds, interests, and personal circumstances. Our team welcomes applicants regardless of their race, gender, age, religion, nationality, sexual orientation, and/or disabilities. All we need is your high energy, skills, and willingness to be a part of a great project!\\n\\nLocation\\n\\nYou'll have the flexibility to choose whether you'd like to come to the office every day, from time to time, or work fully remote. We want you to find the best combination for you.\\n\\nIf you prefer to be surrounded with amazing people, our exceptional office is in Barcelona's Blue Building, located right on the city's seafront. Besides our stunning views, you'll enjoy our office perks such as free fruit, snacks, and coffee and you'll also be able to take part in our Mario Kart and table tennis competitions.\\n\\nThe personal data you provide will be processed in order to manage your candidacy for the corporate selection processes that fit your profile. If you wish, you can exercise your rights of access, rectification or cancellation by writing to our address (Avenida Litoral, 12-14, 5ta planta. Barcelona. 08005) or to the email address protecciondedatos@LeadTech.com, attaching to your request a document that can validate your identity."}	5682	\N
