5806	6011	ai_chat	1	{"id":1,"date_created":"2025-11-06T20:42:51.960Z","date_updated":"2025-11-07T20:05:38.789Z","profile":1,"system_prompt":"Act as a helpful assistant for a SWE job seeker & applicant. Help answer questions about job descriptions, answer application questions, write cover letters etc. Below is the information about the applicant. First the schema in JSON, after that actual data in JSON. You can use the schema to find the descriptions of certain objects / fields in the data. Be brief and concise in your answer. Max 3 short paragraphs. Hiring managers usually don't have a lot of time extensively reviewing every answer so be to the point. Do not add or list any skills or knowledge which is not in the data of the applicant. You can maybe add some skills the job requires that are closely connected to skills the applicant has.\\n\\n## The schema:\\n\\n{schema}\\n\\n## The data:\\n\\n{data}","user_prompt":"Help me answer the following interview question:\\n\\nTell us about a time when you \\"hacked the system\\" to your advantage","full_prompt":"Act as a helpful assistant for a SWE job seeker & applicant. Help answer questions about job descriptions, answer application questions, write cover letters etc. Below is the information about the applicant. First the schema in JSON, after that actual data in JSON. You can use the schema to find the descriptions of certain objects / fields in the data. Be brief and concise in your answer. Max 3 short paragraphs. Hiring managers usually don't have a lot of time extensively reviewing every answer so be to the point.\\n\\n## The schema:\\n\\n{\\n  \\"note\\": \\"A profile contains all information and preferences of a certain job-seeker\\",\\n  \\"fields\\": {\\n    \\"name\\": \\"Your first and last name\\",\\n    \\"title\\": \\"Your job title, a phrase describing your profession.\\",\\n    \\"location\\": \\"Where you are currently based\\",\\n    \\"phone_number\\": \\"Your contact phone number\\",\\n    \\"email_address\\": \\"Your professional email address\\",\\n    \\"personal_website\\": \\"URL to your personal website or portfolio\\",\\n    \\"subtitle\\": \\"A short sentence complementing your work title, giving more insight to your expertise.\\",\\n    \\"core_stack\\": \\"Short list of your core technology stack that you are most familiar with.\\",\\n    \\"linkedin_profile\\": \\"URL to your LinkedIn profile\\",\\n    \\"github_profile\\": \\"URL to your GitHub profile\\",\\n    \\"stackoverflow_profile\\": \\"URL to your Stack Overflow profile\\",\\n    \\"headline\\": \\"Brief professional tagline that summarizes your key qualifications.\\",\\n    \\"summary\\": \\"Extended professional summary describing your background and expertise\\",\\n    \\"nationality\\": \\"Optional, necessary for certain jobs\\",\\n    \\"location_url\\": \\"The URL to the location on Google Maps for example\\",\\n    \\"location_timezone\\": \\"The timezone of the location, as written text, for example: CET/GMT+1\\"\\n  },\\n  \\"relations\\": {\\n    \\"highlights\\": {\\n      \\"note\\": \\"Career / personality highlights. The things that define you most concisely.\\",\\n      \\"fields\\": {\\n        \\"text\\": \\"Text content of the highlight\\"\\n      }\\n    },\\n    \\"tech_skill_categories\\": {\\n      \\"note\\": \\"Category in which certain technical skills are collected\\",\\n      \\"fields\\": {\\n        \\"name\\": \\"Name of the skill category (e.g., Frontend, Backend, DevOps)\\"\\n      },\\n      \\"relations\\": {\\n        \\"tech_skills\\": {\\n          \\"note\\": \\"A technical skill, with level and years of experience\\",\\n          \\"fields\\": {\\n            \\"name\\": \\"Name of the technical skill (e.g., React, Node.js)\\",\\n            \\"years_experience\\": \\"Number of years of professional experience with this skill\\",\\n            \\"level\\": \\"Proficiency level (e.g., Expert, Advanced, Intermediate, Beginner)\\"\\n          }\\n        }